description:
Ze is gekomen met de oostenwind: Mary Poppins, het beroemdste kindermeisje van de wereld. Op een dag is ze letterlijk komen aanwaaien, en daarom is het misschien ook niet zo vreemd dat ze de trap op kan glijden en een lege tas heeft waar toch van alles uitkomt. 
Voor de kinderen van de familie Bank breekt een bijzondere tijd aan, want met Mary Poppins is elke dag een magisch avontuur. Ze hopen dat zij nooit meer weg zal gaan, maar dan draait de wind...

Dit luisterboek bevat 4 CDs en wordt voorgelezen door Bridget Maasland.


